INSERT INTO `cinema` (`ID`, `Name`, `Location`, `Description`, `Count_likes`, `Cost`, `Count_rooms`, `Rooms`, `Img_scr`) VALUES
(2, 'Київська Русь', 'вулиця Січових Стрільців, 93, Київ, 04050', '«Київська Русь» – кінотеатр у Києві. Найбільший український комунальний кінотеатр. Адреса кінотеатру: Київ, вул. Січових Стрільців, 93. Найближча станція метро: Лук\'янівська Побудований на місці кінотеатру «Комунар», відкритий у 1982 році до святкування 1500-річчя Києва.', 4, 140, 2, '[{Name:Rus_room_B1,Size:B}, {Name:Rus_room_S1,Size:S}]', 'images/Cinema/kyivska-rus-2021.jpg'),
(3, 'Лейпциг', 'просп. Леся Курбаса, 8', 'Кінотеатр \"Лейпциг\" пропонує своїм гостям насолодитись перевагами найновіших систем кінопоказу: сучасна система звуку Dolby Digital, акустична система JBL та панорамні екрани Perlux.', 3934, 80, 2, '[{Name:Leyp_room_M1,Size:M}, {Name:Leyp_room_S1,Size:S}]', 'images/Cinema/1538742737lejpcig.png'),
(4, 'Флоренція', 'просп. Маяковського, 31', 'Кінокомплекс \"Флоренція\" збудований у 1989 році і названий на честь Італійського міста-побратима.\nРозташований у зручному місці з гарною транспортною розв\'язкою та паркуванням: пр-т. Маяковського, 31.\n\"Флоренція\" має п\'ять сучасно обладнаних залів. Глядачам кінотеатру Флоренція надається можливість особисто переконатися у перевагах новітньої системи кінопоказу: звуковий Dolby Digital, акустичній JBL, панорамні екрани Perlux, оцінити м\'які крісла та приємну атмосферу затишку та комфорту під час перегляду сучасних кінострічок у цифровому та 3D форматах (червоний останні ряди обладнані місцями для поцілунків (Love Seats) – диван на двох).', 3271, 75, 1, '[{Name:Flor_room_M1,Size:M}]', 'images/Cinema/изображение_2022-04-03_040348.png'),
(5, 'KINOMAN', 'вул. Гетьмана, 6', 'Кінотеатр \"KINOMAN\" (до 2019 року називався \"Баттерфляй-Космополіт) розташований на першому, другому та третьому поверхах Cosmopolite MULTIMALL. KINOMAN має 11 залів, з них 5 на 136 місць, 2 на 82 місць, 1 на 40 місць та 1 на 42 місця, а також 2 VIP-зали на 20 місць, всі вони спроектовані максимально зручно для глядачів, щоб вам було зручно, як вдома, кожен зал обладнаний зручними м\'якими кріслами та окремими підставками для попкорну та напоїв. що дозволяє однаково добре бачити екран з будь-якої точки кінотеатру.', 2076, 90, 11, '[{Name:KinoMan_room_M1,Size:M}, {Name:KinoMan_room_M2,Size:M}, {Name:KinoMan_room_M3,Size:M}, {Name:KinoMan_room_M4,Size:M}, {Name:KinoMan_room_M5,Size:M}, {Name:KinoMan_room_M6,Size:M}, {Name:KinoMan_room_M7,Size:M}, {Name:KinoMan_room_M8,Size:M}, {Name:KinoMan_room_M9,Size:M}, {Name:KinoMan_room_M10,Size:M}, {Name:KinoMan_room_M11,Size:M}]', 'images/Cinema/изображение_2022-04-04_005000.png'),
(6, 'Жовтень', 'вул. Костянтинівська, 26', 'Кінотеатр \"Жовтень\" - один із найстаріших у місті Києві, відкритий у 1931 році. Сьогодні це – сучасний шестизальний кінозаклад загальною місткістю 761 місце.\n\nУ жовтні 2015 року кінотеатр відкритий після реконструкції та повного технічного переоснащення. \"Жовтень\" займає особливе місце на культурній карті столиці України завдяки своїй репертуарній політиці, яка вдало поєднує мейнстрім та авторське, фестивальне кіно.', 2394, 65, 6, '[{Name:Octob_room_B1,Size:B}, {Name:Octob_room_M1,Size:M}, {Name:KinoMan_room_S2,Size:S}, {Name:KinoMan_room_S3,Size:S}, {Name:KinoMan_room_S4,Size:S}]', 'images/Cinema/изображение_2022-04-04_005144.png'),
(7, 'Планета Кіно', 'пр. Степана Бандери, 34В', 'Планета Кіно у Блокбастері – це 8 залів підвищеного комфорту зі зручними кріслами. Наша власна технологія Cinetech+ перетворює кіно на кіно+: насичені кольори на великих екранах від стіни до стіни, особлива геометрія кожного залу, комфортні м\'які крісла та широкі проходи в залі, а останній ряд - це зручні дивани. 3 ексклюзивні зали RE\'LUX\' з унікальним форматом кіноресторану, де перед сеансом ти можеш насолодитися signature-коктейлем у персональному лаунж-барі, а на початку фільму замовити їжу із спеціально розробленого меню finger food через планшет на підлокітниках, не залишаючи залу, наш шеф -кухар приготує все на найвищому рівні. Комфортна приватна зона з VIP кріслами та дбайливе обслуговування від персональних хостес зробить твій відпочинок класу RE\'LUX\'.', 1099, 220, 9, '[{Name:PlanetKino_room_M1,Size:M}, {Name:PlanetKino_room_M2,Size:M}, {Name:PlanetKino_room_M3,Size:M}, {Name:PlanetKino_room_M4,Size:M}, {Name:PlanetKino_room_M5,Size:M}, {Name:PlanetKino_room_M6,Size:M}, {Name:PlanetKino_room_S1,Size:S}, {Name:PlanetKino_room_S2,Size:S}, {Name:PlanetKino_room_S3,Size:S}, {Name:PlanetKino_room_S4,Size:S}]', 'images/Cinema/изображение_2022-04-04_005554.png');
INSERT INTO `films` (`ID`, `Name`, `Category`, `Year`, `Show_date`, `Country`, `Actors`, `Director`, `Description`, `Img_scr`, `Count_likes`, `Film_score`, `Show_time`, `URL_trailer`) VALUES
(1, 'Сутінки', 'Мелодрама, Фентезі, Драма', '2008', '2017-11-20', 'США', 'Крістен Стюарт, Роберт Паттінсон, Біллі Берк, Ешлі Грін, Анна Кендрік, Тейлор Лотнер та інші', 'Кетрін Хардвік', 'Сімнадцятирічна дівчина Белла переїжджає до батька в невелике містечко Форкс. Вона закохується в загадкового однокласника, який, як виявилося, походить із сім\'ї вампірів, які відмовилися від нападів на людей. Закохатися у вампіра. Це страшно? Це романтично, це чудово і болісно, але це не може скінчитися добром, особливо у вічному протистоянні вампірських кланів, де найменша відмінність від оточуючих вже перетворює вас на ворога', 'images/Films/Сумерки.png', 103473, '6.7', 112, 'https://www.youtube.com/watch?v=QDRLSqm_WVg'),
(2, 'Брат 2', 'Бойовик, Кримінал', '2000', '2000-05-21', 'Росія', 'Сергій Бодров мол., Віктор Сухоруков, Сергій Маковецький, Ірина Салтикова, Кирило Пирогов та інші ', 'Олексій Балабанов', 'Беручи участь у програмі на телебаченні, Данило Багров зустрічає своїх друзів по службі Чечні. Одного з них раптово вбивають. З\'ясовується, що у того були неприємності через брата-хокеїста в Америці. Данила повинен розібратися. Він вилітає в Америку і за компанію бере з собою старшого брата.', 'images/Films/brat.png', 836489, '8.1', 126, '=4WZ1gFVN1aI'),
(3, 'Дюна', 'Бойовик, Пригоди, Фантастика, Драма', '2021', '2021-10-22', 'Канада, Великобританія, Франція', 'Тімоті Шаламе, Ребекка Фергюсон, Оскар Айзек, Джош Бролін , Джейсон Момоа та інші', 'Дені Вільньов', 'Спадкоємець знаменитого будинку Атрейдесів Пол вирушає разом із сім\'єю на одну з найнебезпечніших планет у Всесвіті — Арракіс. - неймовірно цінного ресурсу, який називається меланж.В результаті захоплення влади Пол змушений бігти і ховатися, і це стає початком його епічної подорожі. стати обраним.', 'images/Films/Дюна.png', 10324, '7.1', 156, 'https://www.youtube.com/watch?v=Ljzu52GMytk'),
(4, 'Проект Адам', 'Бойовик, Комедія, Пригоди, Фантастика', '2022', '2022-03-11', 'США', 'Райан Рейнодльс, Марк Руффало, Дженніфер Гарнер, Уокер Скобелл, Зої Салдана , Кетрін Кінер та інші', 'Шон Леві', 'Адам Рід, пілот винищувача для подорожей у часі, здійснює аварійну посадку в 2022 році і разом із собою 12-річним вирушає рятувати майбутнє.', 'images/Films/Проект Адам.png', 29432, '6.5', 106, 'https://www.youtube.com/watch?v=MCmVaRfAiyY'),
(5, 'Енканто', 'Бойовик, Комедія, Пригоди, Фантастика', '2021', '2021-11-24', 'США', 'Стефані Беатріз, Марія Сесілія Ботеро, Джон Легуїзамо, Мауро Кастільо, Джесіка Дарроу та інші', 'Джаред Буш, Байрон Ховард, Чаріз Кастро Сміт', 'Нова чарівна пригода Disney «Енканто» розповість історію дивовижної сім\'ї Мадрігалів, що живуть у захованому в горах Колумбії чарівному будинку, розташованому в чудовому і чарівному Кач у Качон. Дитина в сім\'ї Мадригалів магія цього місця благословила унікальним даром - від суперсили до здатності зцілювати.На жаль, магія обійшла стороною одну лише юну Мірабель.Виявивши, що магія Енканто знаходиться в небезпеці, Мірабель вирішує, що саме вона може бути останньою надією на порятунок своєю особливою. сім\'ї.', 'images/Films/Энканто.png', 856422, '7.3', 99, 'https://www.youtube.com/watch?v=f3UaaifZI30'),
(6, 'Втеча з Шоушенка', 'Драма', '1994', '1994-09-22', 'США', 'Тім Роббінс, Морган Фріман, Боб Гантон, Вільям Седлер, Кленсі Браун, Гіл Беллоуз, Марк Ролстон та інші', 'Френк Дарабонт', 'Бухгалтер Енді Дюфрейн звинувачений у вбивстві власної дружини та її коханця. Опинившись у в\'язниці під назвою Шоушенк, він стикається з жорстокістю і беззаконням, що панують по обидва боки грати. Кожен, хто потрапляє в ці стіни. , стає їх рабом до кінця життя. Але Енді, що володіє живим розумом і доброю душею, знаходить підхід як до ув\'язнених, так і до охоронців, домагаючись їх особливого до себе розташування.', 'images/Films/Побег из Шоушенка.png', 735472, '9.3', 144, 'https://www.youtube.com/watch?v=NmzuHjWmXOc'),
(7, 'Форрест Гамп', 'Мелодрама, Драма', '1994', '1994-07-06', 'США', 'Том Хенкс, Робін Райт, Гері Сініз, Майкелті Вільямсон, Саллі Філд, Ребекка Вільямс і інші', 'Роберт Земекіс', 'Сидячи на автобусній зупинці, Форрест Гамп - не дуже розумний, але добрий і відкритий хлопець - розповідає випадковим зустрічним історію свого незвичайного життя. З дитинства він страждав від захворювання ніг, і сусідські хулігани дражнили хлопчика, і одного прекрасного дня Форрест відкрив у собі неймовірні здібності до бігу. Подруга дитинства Дженні завжди його підтримувала і захищала, але незабаром їх дороги розійшлися.', 'images/Films/Форрест Гамп.png', 932263, '9.0', 144, 'https://www.youtube.com/watch?v=bLvqoHBptjg'),
(8, 'Кримінальне чтиво', 'Кримінал, Трилер, Драма', '1994', '1994-10-14', 'США', 'Джон Траволта, Семюел Л. Джексон, Брюс Вілліс, Ума Турман, Вінг Реймз , Тім Рот, Харві Кейтель, Квентін Тарантіно, Пітер Грін та інші', 'Квентін Тарантіно', 'Двоє бандитів Вінсент Вега та Джулс Вінфілд ведуть філософські бесіди у перервах між розбираннями та вирішенням проблем з боржниками кримінального боса Марселласа Уоллеса.', 'images/Films/Криминальное чтиво.png', 1987253, '8.8', 154, 'https://www.youtube.com/watch?v=s7EdQ4FqbhY'),
(9, 'Матриця', 'Бойовик, Фантастика', '1999', '1999-03-31', 'США, Австралія', 'Кіану Рівз, Лоренс Фішберн, Керрі-Енн Мосс, Хьюго Уівінг, Джо Пантольяно, Глорія Фостер, Маркус Чонг та інші', 'Лана Вачовскі, Ліллі Вачовскі', 'Життя Томаса Андерсона поділено на дві частини: днем він - звичайнісінький офісний працівник, який отримує наздоганяння від начальства, а вночі перетворюється на хакера на ім\'я Нео, і ні місця в мережі, куди він би не зміг проникнути. Але одного разу все змінюється. Томас дізнається жахливу правду про реальність.', 'images/Films/Матрица.png', 1987414, '8.9', 136, 'https://www.youtube.com/watch?v=vKQi3bBA1y8'),
(10, '1+1', 'Комедія, Драма', '2011', '2017-08-10', 'Франція', 'Франсуа Клюзе, Омар Сі, Одрі Флеро, Анн Ле Ні, Жозефін де Мо, Клотільд Молле та інші', 'Олів\'є Накаш, Ерік Толедано', 'Постраждавши внаслідок нещасного випадку, багатий аристократ Філіпп наймає в помічники людину, яка найменше підходить для цієї роботи, — молодого жителя передмістя Дрісса, який щойно звільнився з в\'язниці. на те, що Філіп прикутий до інвалідного крісла, Дрісс вдається привнести в розмірене життя аристократа дух пригод.', 'images/Films/1+1.png', 409726, '8.5', 112, 'https://www.youtube.com/watch?v=zx2o_2GHZ88'),
(11, 'Темний лицар: Відродження легенди', 'Бойовик, Кримінал, Трилер, Фантастика, Драма', '2012', '2012-07-26', 'США, Великобританія', 'Крістіан Бейл, Том Харді, Енн Хетеуей, Джозеф Гордон-Левітт, Маріон Котійяр, Гарі Олдман, Морган Фріман, Майкл Кейн та інші', 'Крістофер Нолан', 'Вісім років тому Бетмен розчинився в ночі, перетворившись з героя на втікача. Взявши на себе провину за смерть прокурора Харві Дента він пожертвував усім, разом з комісаром Гордоном вони вирішили, що так буде краще для всіх, поки злочинність була роздавлена антикримінальним актом Дента, брехня діяла. Тим не менш, ще небезпечнішою стає поява нового ворога Бейна, чиє обличчя закрите маскою. Він розгортає у Готемі жахливу діяльність, і це змушує Брюса Уейна вийти з імпровізованого вигнання. Однак, навіть одягнувши свій костюм, Бетмен може програти Бейну. Але з появою хитрою злодійки на прізвисько Жінка — Кішка із загадковим минулим все змінюється.', 'images/Films/Темный рыцарь Возрождение легенды.png', 1623888, '8.1', 165, 'https://www.youtube.com/watch?v=g8evyE9TuYk'),
(12, 'Аквамен', 'Бойовик, Фентезі', '2018', '2018-12-13', 'США', 'Джейсон Момоа, Ембер Герд, Патрік Вілсон, Віллем Дефо, Ніколь Кідман та інші', 'Джеймс Ван', 'Артур Каррі був сином працівника маяка на ім\'я Том Каррі та жінки на ім\'я Атланна. Артур вже в підлітковому віці демонстрував неймовірну силу та швидкість, а також можливість дихати під водою та розмовляти з рибами. Будучи при смерті, Атланна розкрила хлопчику правду: вона була Королевою Атлантиди, яка перебувала у вигнанні, і пообіцяла, що якось Артур стане правителем семи морів. Його батько дав йому освіту і навчив керувати своїми можливостями, що зрештою допомогло йому стати героєм на ім\'я Аквамен.', 'images/Films/Аквамен.png', 732554, '6.8', 143, 'https://www.youtube.com/watch?v=zuVygAE7tKw'),
(13, 'Хрещений батько', 'Кримінал, Драма', '1972', '1972-03-14', 'США', 'Марлон Брандо, Аль Пачіно, Джеймс Каан, Роберт Дюваль та інші', 'Френсіс Форд Коппола', 'Кримінальна сага, що розповідає про нью-йоркську сицилійську мафіозну родину Корлеона. Фільм охоплює період 1945-1955 років. Глава сім\'ї, Дон Віто Корлеон, видає заміж свою дочку. У цей час із Другої світової війни повертається його улюблений син Майкл. Майкл, герой війни, гордість сім\'ї, не висловлює бажання зайнятися жорстоким сімейним бізнесом. Дон Корлеоне веде справи за старими правилами, але настають інші часи, і з\'являються люди, які бажають змінити порядки, що склалися. На Дона Корлеоні вчинено замах.', 'images/Films/Крёстный отец.png', 2076322, '8.7', 175, 'https://www.youtube.com/watch?v=fB_8VCwXydM'),
(14, 'Хрещений батько 2', 'Кримінал, Драма', '1974', '1974-12-20', 'США', 'Аль Пачіно, Роберт Де Ніро, Дайан Кітон, Роберт Дювалл, Джон Казале та інші', 'Френсіс Форд Коппола', 'У центрі драми представники нового покоління гангстерського клану - дона Корлеоне та його сина, для яких не існує моральних перешкод на шляху досягнення поставлених цілей. Вони перетворюють мафію, побудовану за патріархальними, ще сицилійськими законами, на досить прагматичну, жорстку корпорацію, що плавно інтегрується у великий бізнес Америки.', 'images/Films/Крёстный отец 2.png', 2076673, '8.5', 200, 'https://www.youtube.com/watch?v=9O1Iy9od7-A'),
(15, 'Хрещений батько 3', 'Кримінал, Драма', '1990', '1990-12-25', 'США', 'Аль Пачіно, Енді Гарсіа, Дайан Кітон, Талія Шайр, Ілай Воллак, Джо Мантенья та інші', 'Френсіс Форд Коппола', 'Через двадцять років після подій, описаних у попередній картині, Майкл Корлеоне вирішує зайнятися легальним бізнесом. Проте протидія всередині клану змушує його згадати про випробувані криваві методи спілкування з противником, що призводить до трагічного результату. ', 'images/Films/Крёстный отец 3.png', 1705324, '7.9', 170, 'https://www.youtube.com/watch?v=UUkG37KSWf0'),
(16, 'Анчартед: На картах не значиться', 'Бойовик, Пригоди', '2022', '2022-02-18', 'США, Іспанія', 'Том Холланд, Марк Уолберг, Антоніо Бандерас, Софія Тейлор Алі , Таті Габріель, Стівен Уоддінгтон та інші', 'Рубен Фляйшер', 'Два шукачі пригод Нейтан Дрейк і Віктор Салліван на прізвисько Саллі вирушають на пошуки найбільшого скарбу світу. Крім того, вони сподіваються знайти докази, які приведуть їх до давно втраченого брата .', 'images/Films/Анчартед На картах не значится.png', 529873, '7.0', 115, 'https://www.youtube.com/watch?v=C1G7baJAKrw'),
(21, 'Індіана Джонс: У пошуках втраченого ковчега', 'Бойовик, Комедія, Пригоди', '1981', '1981-06-12', 'США', 'Харрісон Форд, Карен Аллен, Пол Фрімен, Рональд Лейсі , Джон Ріс-Девіс, Денхолм Елліот та інші', 'Стівен Спілберг', 'Відомий археолог і фахівець з окультних наук доктор Джонс отримує небезпечне завдання від уряду США. Він повинен вирушити на пошуки унікальної реліквії - священного Ковчега. Але Індіана і не підозрює , що аналогічний наказ вже отримали таємні агенти Адольфа Гітлера.', 'images/Films/Индиана Джонс В поисках утраченного ковчега.png', 529873, '8.0', 115, 'https://www.youtube.com/watch?v=0xQSIdSRlAk'),
(22, 'Мумія', 'Бойовик, Комедія, Пригоди', '1999', '1999-05-04', 'США, Великобританія, Марокко', 'Брендан Фрейзер, Рейчел Вайс, Джон Ханна, Арнольд Вослу, Кевін Дж. О\'Коннор, Джонатан Хайд та інші', 'Стівен Соммерс', 'На безкраїх просторах єгипетської пустелі компанія шибайголов різних національностей нишпорить у пошуках незліченні скарби фараона, над якими тяжіє моторошне древнє прокляття.', 'images/Films/Мумия.png', 2054721, '7.8', 124, 'https://www.youtube.com/watch?v=f7oKxlaUBac'),
(23, 'Ван Хельсінг', 'Бойовик, Комедія, Пригоди', '2004', '2004-05-07', 'США, Чехія, Румунія', 'Х\'ю Джекман, Кейт Бекінсейл, Річард Роксбург, Девід Уенем, Шулер Хенслі, Олена Анайя та інші', 'Стівен Соммерс', 'Глибоко в Карпатах лежить таємнича країна Трансільванія — світ, у якому зло зустрічається на кожному кроці, світ, у якому небезпека оживає із заходом сонця, і де монстри, що живуть у глибині людських кошмарів набувають форми, у цей світ потрапляє легендарний мисливець на чудовиськ Ван Хельсинг.', 'images/Films/Ван Хельсинг.png', 1054788, '7.6', 130, 'https://www.youtube.com/watch?v=3fdRKme00uI'),
(24, 'Ліга справедливості: Зака Снайдера', 'Бойовик, Пригоди, Фантастика, Фентезі', '2021', '2021-03-18', 'США', 'Бен Аффлек, Галь Гадот, Генрі Кавіл, Джейсон Момоа , Езра Міллер, Рей Фішер, Ембер Херд, Джаред Літо, Емі Адамс, Джессі Айзенберг', 'Зак Снайдер', 'Надихнувшись самопожертвою Супермена, Брюс Уейн знову знаходить віру в людство. Він заручається підтримкою нової союзниці Діани Бетмен і Чудо-жінка набирають команду надлюдей для боротьби з пробудженою загрозою.', 'images/Films/Лига справедливости Зака Снайдера.png', 377670, '7.9', 240, 'https://www.youtube.com/watch?v=YU-SRTGzY1k'),
(25, 'Лівша', 'Драма, Спорт', '2015', '2015-06-20', 'США, Гонконг', 'Джейк Джілленхол, Рейчел МакАдамс, Форест Уітакер, Уна Лоуренс, Фіфті Сент, Скайлан Брукс , Наомі Харріс, Віктор Ортіс, Бо Напп, Мігель Гомес', 'Антуан Фукуа', 'Професійний боксер Біллі «Великий» Хоуп лідирує в середній вазі. У цього хлопця навіть є своя оригінальна тактика, яка отримала назву «Лівша». в ефективному, але в той же час жорсткому наступальному бою.Підживлення Біллі черпає з власних почуттів неповноцінності.Він відчайдушно потребує любові, слави і грошах.У нього є прекрасна дружина Морін і маленька дочка.Їх сім\'ю можна назвати зразковою, адже тут панує гармонія У сім\'ї є свій будинок і фінансове забезпечення на хорошому рівні.Чоловік перебуває на піку своєї кар\'єри, але тільки він починає все більше пропускати удари.Морін просить Біллі залишити цю діяльність, піти з боксу.', 'images/Films/Левша.png', 233434, '7.3', 124, 'https://www.youtube.com/watch?v=oGVDfZ4RzpA'),
(26, 'Лабіринт Фавна', 'Військовий, Детектив, Драма, Трилер, Фентезі', '2006', '2027-05-20', 'Іспанія, Мексика, США', 'Івана Бакеро, Серхі Лопес, Марібель Верду , Даг Джонс, Аріадна Хіль, Алекс Ангуло, Маноло Соло, Сесар Веа, Рохер Касамахор, Іван Массаге', 'Гільєрмо дель Торо', '1944 рік. Перед нами Іспанія. Чарівні гірські ліси Наварри. Але їх краса і краса природи битвами.Група повстанців відстоює свої переконання.Щоденні битви з фашистами і пролиття крові невинних.Кармен - мати Офелії і дружина одного з капітанів.Відаль - вітчим дівчинки, страшна людина. Зарозумілість і жорстокість супроводжують його по життю.Йому як офіцеру дано завдання від повстанців Така людина не бачить перед собою перешкод. Подібний лиходій явно не відповідає \"званню\" батька для юної, десятирічної фантазерки. Вона живе у світі казок і чарівництва. Виявивши старовинний лабіринт, давно покинутий людьми, вона мужньо вирушає на пошуки пригод .Фея, яка зустрілася їй, супроводжує юну леді до Фавна. Він, будучи хранителем підземелля, розповідає їй одну історію. За його словами, Офелія потрапила в цей світ не просто так. Її місце саме тут, адже вона принцеса, що зникла. Король уже багато століть шукає свою дочку. Справжнє призначення шукачки таємниць – правити цілим королівством. Але для цього їй потрібно виконати умови Фавна. Зберігати в таємниці все, що з нею станеться, і три випробування. Потрібно попрацювати для здійснення поставлених цілей.', 'images/Films/Лабиринт Фавна.png', 657009, '8.2', 118, 'https://www.youtube.com/watch?v=jVZRnnVSQ8k'),
(27, 'Бій з тінню', 'Бойовик, Драма', '2005', '2017-03-20', 'Росія', 'Деніс Нікіфоров, Андрій Панін, Олена Панова, Дмитро Шевченко, Олександр Кузнєцов, Джон Еймос , Павло Дерев\'янко, Сергій Безруков, Іван Макаревич, Микита Звєрєв', 'Олексій Сидоров', 'Артем Колчин був одним з багатьох, але мріяв про славу. Вибравши свій шлях у житті, він стає боксером. Тепер Артем претендує на титул чемпіона, бійця, якого знатиме весь світ, він має стати Великою Білою Надією, проте в головному в його житті бою все пішло не так, як передбачалося, тепер у нього проблеми не тільки на рингу і він повинен придумати, як їх вирішити. розпорядженні всього три дні, щоб ті, хто його зрадили, були покарані, щоб захистити кохану і знайти велику суму грошей.В реальному часі доводиться битися без рукавичок і правил, а рингом стають вулиці великого міста.Тут не буває рефері, що зупиняє бій боєць скрізь боєць.', 'images/Films/Бой с тенью.png', 2048, '5.9', 126, 'https://www.youtube.com/watch?v=xXkCVrk2aFw');
